INSERT INTO `markdowns` (`id`, `contentHTML`, `contentMarkdown`, `description`, `doctorId`, `specialtyId`, `clinicId`, `createdAt`, `updatedAt`) VALUES
(3, '<p><strong>Bác sĩ Chuyên khoa I Phan Vương Huy Đổng</strong></p>\n<ul>\n<li>Hơn 30 năm kinh nghiệm khám và điều trị về Cơ xương khớp - Chấn thương chỉnh hình</li>\n<li>Bác sĩ từng công tác tại Khoa Y học thể thao, Bệnh viện Nhân dân 115</li>\n<li>Bác sĩ từng công tác tại Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM</li>\n<li>Phó Chủ tịch Hội y học thể thao TP.HCM</li>\n<li>Đào tạo và huấn luyện nội soi khớp cho các Bác sĩ chuyên khoa tại Bệnh viện Nhân dân 115 (2005 - 2009)</li>\n<li>Bác sĩ nhận khám từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)</li>\n<li>Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai</li>\n<li>Chấn thương đứt dây chằng khớp gối</li>\n<li>Chấn thương rách đứt dây chằng cổ chân</li>\n<li>Chấn thương rách lật khớp vai</li>\n<li>Chấn thương rách gân khớp vai</li>\n<li>Các bệnh lý đặc biệt trong thể thao</li>\n<li>Bệnh thoái hóa cột sống, đĩa đệm, cổ tay</li>\n<li>Bệnh lý khớp gối</li>\n<li>Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)</li>\n<li>Gai gót chân</li>\n<li>Bệnh lý gối lệch trục xương ( vẹo trong, vẹo ngoài )</li>\n<li>Thoái hóa khớp háng</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Bác sĩ Bộ môn Y học thể thao, Trường Đại học Y khoa Phạm Ngọc Thạch (1991 - 2018)</li>\n<li>Bác sĩ Khoa Y học thể thao, Bệnh viện Nhân dân 115 (2005 - 2011)</li>\n<li>Bác sĩ Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1991 - 2005)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Bác sĩ Chuyên khoa I Chuyên khoa Chấn thương chỉnh hình, Trường Đại học Y dược TP.HCM (1993 - 1995)</li>\n<li>Bác sĩ Đa khoa, Trường Đại học Y dược TP.HCM (1984 - 1990)</li>\n<li>Chứng chỉ nội soi khớp tại Đai học Chulalongkorn Thái Lan</li>\n<li>Tập huấn về nội soi tại Singapore &amp; Hàn Quốc</li>\n<li>Sách và các công trình nghiên cứu, báo cáo khoa học</li>\n<li>Đào tạo và huấn luyện nội soi khớp cho các Bác sĩ chuyên khoa tại Bệnh viện Nhân dân 115 (2005 - 2009)</li>\n<li>Nội soi tái tạo Dcer gân Hemisting, báo cáo tại Hàn Quốc (2005 - 2008)</li>\n<li>Nội soi khớp gối, tái tạo dây chằng chéo trước, bông gân bánh chè (1999 - 2003)</li>\n<li>Điều trị bảo tồn gãy 2 xương cẳng chân tại Bệnh viện Chấn thương chỉnh hình</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội viên Hội chỉnh hình TP.HCM</li>\n<li>Hội viên Hội chỉnh hình Việt Nam</li>\n<li>Phó Chủ tịch Hội y học thể thao TP.HCM</li>\n<li>Ủy viên ban chấp hành Hội y học TP.HCM</li>\n<li>Trung tâm huấn luyện nội soi khớp Sài Gòn SAC</li>\n</ul>\n<p><strong>Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình…</strong></p>\n<ul>\n<li>Chấn thương thể thao: chi trên, chi dưới, cột sống</li>\n<li>Thể thao người già</li>\n<li>Thể thao phụ nữ</li>\n<li>Thể thao ở trẻ em</li>\n<li>Báo người lao động - Thể thao TP.HCM - Tuổi trẻ (1998 - 2005)</li>\n<li>Các chương trình Sức khỏe và đời sống - HTV - KTV - VTV (cộng tác viên thường xuyên)</li>\n<li>Giảng dạy các khóa Y học thể thao cho các huấn luyện viên cấp Thành phố, Quốc gia: cử tạ thể thao, quần vợt…</li>\n</ul>\n', '**Bác sĩ Chuyên khoa I Phan Vương Huy Đổng**\n* Hơn 30 năm kinh nghiệm khám và điều trị về Cơ xương khớp - Chấn thương chỉnh hình\n* Bác sĩ từng công tác tại Khoa Y học thể thao, Bệnh viện Nhân dân 115\n* Bác sĩ từng công tác tại Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM\n* Phó Chủ tịch Hội y học thể thao TP.HCM\n* Đào tạo và huấn luyện nội soi khớp cho các Bác sĩ chuyên khoa tại Bệnh viện Nhân dân 115 (2005 - 2009)\n* Bác sĩ nhận khám từ 16 tuổi trở lên\n\n**Khám và điều trị**\n* Chấn thương khớp gối, vai, cột sống (trong tai nạn sinh hoạt, chấn thương thể thao)\n* Đứt dây chằng gối, dẹp rách sụn gối - trật khớp vai\n* Chấn thương đứt dây chằng khớp gối\n* Chấn thương rách đứt dây chằng cổ chân\n* Chấn thương rách lật khớp vai\n* Chấn thương rách gân khớp vai\n* Các bệnh lý đặc biệt trong thể thao\n* Bệnh thoái hóa cột sống, đĩa đệm, cổ tay\n* Bệnh lý khớp gối\n* Hội chứng Tennis Elbow (viêm lồi cầu ngoài xương cánh tay là chấn thương thường gặp ở người chơi tennis)\n* Gai gót chân\n* Bệnh lý gối lệch trục xương ( vẹo trong, vẹo ngoài )\n* Thoái hóa khớp háng\n\n**Quá trình công tác**\n* Bác sĩ Bộ môn Y học thể thao, Trường Đại học Y khoa Phạm Ngọc Thạch (1991 - 2018)\n* Bác sĩ Khoa Y học thể thao, Bệnh viện Nhân dân 115 (2005 - 2011)\n* Bác sĩ Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP.HCM (1991 - 2005)\n\n**Quá trình đào tạo**\n* Bác sĩ Chuyên khoa I Chuyên khoa Chấn thương chỉnh hình, Trường Đại học Y dược TP.HCM (1993 - 1995)\n* Bác sĩ Đa khoa, Trường Đại học Y dược TP.HCM (1984 - 1990)\n* Chứng chỉ nội soi khớp tại Đai học Chulalongkorn Thái Lan\n* Tập huấn về nội soi tại Singapore & Hàn Quốc\n* Sách và các công trình nghiên cứu, báo cáo khoa học\n* Đào tạo và huấn luyện nội soi khớp cho các Bác sĩ chuyên khoa tại Bệnh viện Nhân dân 115 (2005 - 2009)\n* Nội soi tái tạo Dcer gân Hemisting, báo cáo tại Hàn Quốc (2005 - 2008)\n* Nội soi khớp gối, tái tạo dây chằng chéo trước, bông gân bánh chè (1999 - 2003)\n* Điều trị bảo tồn gãy 2 xương cẳng chân tại Bệnh viện Chấn thương chỉnh hình\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Hội viên Hội chỉnh hình TP.HCM\n* Hội viên Hội chỉnh hình Việt Nam\n* Phó Chủ tịch Hội y học thể thao TP.HCM\n* Ủy viên ban chấp hành Hội y học TP.HCM\n* Trung tâm huấn luyện nội soi khớp Sài Gòn SAC\n\n**Tham gia các chuyên đề sức khỏe trên báo chí, truyền hình…**\n* Chấn thương thể thao: chi trên, chi dưới, cột sống\n* Thể thao người già\n* Thể thao phụ nữ\n* Thể thao ở trẻ em\n* Báo người lao động - Thể thao TP.HCM - Tuổi trẻ (1998 - 2005)\n* Các chương trình Sức khỏe và đời sống - HTV - KTV - VTV (cộng tác viên thường xuyên)\n* Giảng dạy các khóa Y học thể thao cho các huấn luyện viên cấp Thành phố, Quốc gia: cử tạ thể thao, quần vợt…', '\nBác sĩ Chuyên khoa I Phan Vương Huy Đổng\nHơn 30 năm kinh nghiệm khám và điều trị về Cơ xương khớp - Chấn thương chỉnh hình\nBác sĩ từng công tác tại Khoa Y học thể thao, Bệnh viện Nhân dân 115\nBác sĩ từng công tác tại Khoa Chi dưới, Bệnh viện Chấn thương chỉnh hình TP. HCM\nBác sĩ nhận khám từ 16 tuổi trở lên ', 5, NULL, NULL, '2024-06-12 17:37:54', '2024-06-12 17:37:54'),
(4, '<p><strong>Thạc sĩ, BSCKII Đào Trường</strong></p>\n<ul>\n<li>Hơn 20 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng</li>\n<li>Giám Đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn</li>\n<li>Trưởng khoa Tai Mũi Họng, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn</li>\n<li>Bác sĩ nhận khám mọi độ tuổi</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn</li>\n<li>Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em</li>\n<li>Nội soi Tai Mũi Họng</li>\n<li>Thực hiện các qui trình kỹ thuật Tai Mũi Họng</li>\n</ul>\n<p><strong>Các bệnh về tai</strong></p>\n<ul>\n<li>Ù tai, nghe kém, điếc đột ngột</li>\n<li>Chẩy mủ tai, viêm tai giữa cấp, mạn</li>\n<li>Vá màng nhĩ nội soi</li>\n<li>Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài</li>\n</ul>\n<p><strong>Các bệnh mũi xoang</strong></p>\n<ul>\n<li>\n<p>Viêm mũi xoang dị ứng, viêm mũi vận mạch</p>\n</li>\n<li>\n<p>Viêm mũi ngạt tắc mũi mạn tính</p>\n</li>\n<li>\n<p>Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang</p>\n</li>\n<li>\n<p>Nấm mũi xoang</p>\n</li>\n<li>\n<p>Đau đầu mạn tính do mũi xoang…\n**\nCác bệnh về họng thanh quản**</p>\n</li>\n<li>\n<p>Ở trẻ em viêm VA, viêm mũi họng mạn tính</p>\n</li>\n<li>\n<p>Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)</p>\n</li>\n<li>\n<p>Viêm amiđan cấp, mạn</p>\n</li>\n<li>\n<p>Nạo V.A</p>\n</li>\n<li>\n<p>Cắt Amidan</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Giám đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2020 - Nay)</li>\n<li>Trưởng khoa Tai Mũi Họng, Bệnh viện FV (2019 - 2020)</li>\n<li>Bác sĩ điều trị khoa Tai Mũi Họng, Bệnh viện FV (2008 - 2019)</li>\n<li>Bác sĩ khoa Tai Mũi Họng, Bệnh viện Nhi đồng 1 (2003 - 2008)</li>\n<li>Bác sĩ Nội trú khoa Tai Mũi Họng, Bệnh viện Chợ Rẫy (1999 - 2003)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Chuyên khoa Cấp II, Tai Mũi Họng, Đại học Y Khoa Phạm Ngọc Thạch (2022)</li>\n<li>Thạc sĩ Y khoa, Tai Mũi Họng, Đại học Y Dược Thành phố Hồ Chí Minh (2005)</li>\n<li>Chuyên khoa Cấp I, Tai Mũi Họng, Đại học Y Dược Thành phố Hồ Chí Minh (2003)</li>\n</ul>\n<p><strong>Đào tạo nâng cao</strong></p>\n<ul>\n<li>Phẫu thuật Đầu cổ trên xác ở Bệnh viện Rajavithi, Băng Cốc, Thái Lan (2019)</li>\n<li>Phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn, phẫu thuật xoang và sàn sọ, Đại Học Stanford, California, Mỹ (2017)</li>\n<li>Nghiên cứu lâm sàng trong Tai Mũi Họng, Bệnh viện Chang Gung Cao Hung, Cao Hùng, Đài Loan (2016)</li>\n<li>Học kỹ thuật phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn nâng cao tại Bệnh viện SGH Singapore (2013)</li>\n<li>Phẫu thuật nội soi mũi xoang và sàn sọ, Bộ môn Tai Mũi Họng, Khoa Y, Trường Đại Học Bắc Carolina, Mỹ (2012)</li>\n<li>Kỹ thuật phẫu thuật cấy ghép thiết bị nghe nâng cao, Bệnh viện đa khoa Cheng Hsin, Đài Loan (2011)</li>\n<li>Phẫu thuật Phục hồi và Phẫu thuật thẩm mỹ vùng mặt, Đại học Y Dược Thành phố Hồ Chí Minh (2001)</li>\n</ul>\n', '**Thạc sĩ, BSCKII Đào Trường**\n* Hơn 20 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng\n* Giám Đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\n* Trưởng khoa Tai Mũi Họng, Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\n* Bác sĩ nhận khám mọi độ tuổi\n\n**Khám và điều trị**\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng người lớn\n* Chuyên khám và điều trị các bệnh lý Tai Mũi Họng trẻ em\n* Nội soi Tai Mũi Họng\n* Thực hiện các qui trình kỹ thuật Tai Mũi Họng\n\n**Các bệnh về tai**\n\n* Ù tai, nghe kém, điếc đột ngột\n* Chẩy mủ tai, viêm tai giữa cấp, mạn\n* Vá màng nhĩ nội soi\n* Phát hiện sớm và điều trị tốt bệnh viêm tai giữa màng nhĩ đóng kín, không chẩy mủ ra ngoài\n\n**Các bệnh mũi xoang**\n\n* Viêm mũi xoang dị ứng, viêm mũi vận mạch\n* Viêm mũi ngạt tắc mũi mạn tính\n* Viêm đa xoang mạn lâu ngày khó khỏi, polyp mũi xoang\n* Nấm mũi xoang\n* Đau đầu mạn tính do mũi xoang…\n**\nCác bệnh về họng thanh quản**\n\n* Ở trẻ em viêm VA, viêm mũi họng mạn tính\n* Các biến chứng của viêm VA (như viêm tai thanh dịch, viêm tai giữa cấp, viêm thanh khí phế quản….)\n* Viêm amiđan cấp, mạn\n* Nạo V.A\n* Cắt Amidan\n\n**Quá trình công tác**\n* Giám đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn (2020 - Nay)\n* Trưởng khoa Tai Mũi Họng, Bệnh viện FV (2019 - 2020)\n* Bác sĩ điều trị khoa Tai Mũi Họng, Bệnh viện FV (2008 - 2019)\n* Bác sĩ khoa Tai Mũi Họng, Bệnh viện Nhi đồng 1 (2003 - 2008)\n* Bác sĩ Nội trú khoa Tai Mũi Họng, Bệnh viện Chợ Rẫy (1999 - 2003)\n\n**Quá trình đào tạo**\n* Chuyên khoa Cấp II, Tai Mũi Họng, Đại học Y Khoa Phạm Ngọc Thạch (2022)\n* Thạc sĩ Y khoa, Tai Mũi Họng, Đại học Y Dược Thành phố Hồ Chí Minh (2005)\n* Chuyên khoa Cấp I, Tai Mũi Họng, Đại học Y Dược Thành phố Hồ Chí Minh (2003)\n\n**Đào tạo nâng cao**\n* Phẫu thuật Đầu cổ trên xác ở Bệnh viện Rajavithi, Băng Cốc, Thái Lan (2019)\n* Phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn, phẫu thuật xoang và sàn sọ, Đại Học Stanford, California, Mỹ (2017)\n* Nghiên cứu lâm sàng trong Tai Mũi Họng, Bệnh viện Chang Gung Cao Hung, Cao Hùng, Đài Loan (2016)\n* Học kỹ thuật phẫu thuật điều trị ngáy và ngưng thở khi ngủ do tắc nghẽn nâng cao tại Bệnh viện SGH Singapore (2013)\n* Phẫu thuật nội soi mũi xoang và sàn sọ, Bộ môn Tai Mũi Họng, Khoa Y, Trường Đại Học Bắc Carolina, Mỹ (2012)\n* Kỹ thuật phẫu thuật cấy ghép thiết bị nghe nâng cao, Bệnh viện đa khoa Cheng Hsin, Đài Loan (2011)\n* Phẫu thuật Phục hồi và Phẫu thuật thẩm mỹ vùng mặt, Đại học Y Dược Thành phố Hồ Chí Minh (2001)', 'Hơn 20 năm kinh nghiệm trong lĩnh vực Tai Mũi Họng\nGiám Đốc chuyên môn Bệnh viện Đa khoa Quốc tế Nam Sài Gòn\nBác sĩ nhận khám mọi độ tuổi', 1, NULL, NULL, '2024-06-21 10:48:08', '2024-06-21 10:48:08');

